using IntervalArithmetic
using DataStructure
using BenchTest

y = DataVariable("y","real",@interval(-Inf,+Inf))
x1 = DataVariable("x1","real",@interval(4,3969/625))
x2 = DataVariable("x2","real",@interval(4,3969/625))
x3 = DataVariable("x3","real",@interval(4,3969/625))
x4 = DataVariable("x4","real",@interval(4,3969/625))
x5 = DataVariable("x5","real",@interval(4,3969/625))
x6 = DataVariable("x6","real",@interval(4,3969/625))
c1 = DataConstant("c1","int",0)
eps = DataConstant("eps","real",10^-10) 

variables = [y, x1, x2, x3, x4, x5, x6]
constants = [c1]

C = DataConstraint("C_delta",
                   constants,
                   variables,
                   "=",
                   y,
                   DataBinaryOperation("+",
                                       DataBinaryOperation("+",
                                                           DataBinaryOperation("+",
                                                                               DataBinaryOperation("+",
                                                                                                   DataBinaryOperation("+",
                                                                                                                       DataBinaryOperation("+",
                                                                                                                                           DataBinaryOperation("*", DataBinaryOperation("*", x1,x4), DataBinaryOperation("+", DataBinaryOperation("+", DataBinaryOperation("-", DataBinaryOperation("+", DataBinaryOperation("+", DataBinaryOperation("-",c1, x1), x2), x3), x4), x5), x6)),
                                                                                                                                           DataBinaryOperation("*", DataBinaryOperation("*", x2, x5), DataBinaryOperation("+", DataBinaryOperation("-", DataBinaryOperation("+", DataBinaryOperation("+", DataBinaryOperation("-", x1, x2), x3), x4), x5), x6))),
                                                                                                                       DataBinaryOperation("*", DataBinaryOperation("*", x3, x6), DataBinaryOperation("-", DataBinaryOperation("+", DataBinaryOperation("+", DataBinaryOperation("-", DataBinaryOperation("+", x1, x2), x3), x4), x5), x6))),
                                                                                                   DataBinaryOperation("*", DataBinaryOperation("*", DataBinaryOperation("-", c1, x2), x3), x4)),
                                                                               DataBinaryOperation("*", DataBinaryOperation("*", DataBinaryOperation("-",c1, x1), x3), x5)),
                                                           DataBinaryOperation("*", DataBinaryOperation("*", DataBinaryOperation("-",c1, x1), x2), x6)),
                                       DataBinaryOperation("*", DataBinaryOperation("*", DataBinaryOperation("-",c1, x4), x5), x6)),
                   eps)

test(C, variables, constants, ARGS)
